  CONSTRAINT `t_pungut_pd_ibfk_4` FOREIGN KEY (`id_rek_pd`) REFERENCES `t_rek_pd` (`id_rek_pd`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `t_pungut_pd_ibfk_5` FOREIGN KEY (`id_bulan`) REFERENCES `t_bulan` (`id_bulan`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

